import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';

function Div(props){
  return (
<div className="card">

<div className="pic">
 <img src={props.imgs}  alt="msd"/>

<div className="info">

<p>{props.para}</p>
<a href ={props.link} alt="msd">

Click here below to watch
<br></br>
<button >Click here dude!</button>
</a>


</div>

</div>


</div>
  );
}

ReactDOM.render(
  <React.Fragment>
  <Div  imgs="./img/download.jpeg" para= "MS Dhoni : The untold Story" link="https://www.hotstar.com/in/movies/ms-dhoni-the-untold-story/1770003314/watch"/>
  <Div  imgs="./img/half.jpeg" para= "Half Girlfriend" link="https://www.netflix.com/title/80192420"/>
  <Div  imgs="./img/iron.jpg" para= "IronMan" link="https://www.hotstar.com/in/movies/iron-man/1660000038/watch?utm_source=gwa"/>
  <Div  imgs="./img/stree.webp" para= "Stree" link="https://www.netflix.com/title/81113921"/>

  </React.Fragment>
  ,
  document.getElementById('root')
);
